import React, { Component } from 'react'
import { Link } from 'react-router-dom'

class HeaderComponent extends Component {
    render() {
        return (
            <header>
               <nav>
                   <div><a>in28Minutes</a></div>
                   <ul class="nav">
                       <li>Home</li>
                       <li>todos</li>
                   </ul>
                   <ul class="nav">
                       <li>Login</li>
                       <li>Logout</li>
                   </ul>
               </nav>
            </header>

        )
    }
}
export default HeaderComponent;
